    return movies;
}
const MovieComponent = () => {
    const movieData = fetchMovieData();

    return (
        <div className="movie-container">
            <h2>Movies</h2>
            <ul className="movie-list">
                {
                    movies.map((movie)=>(
                        <Movie key={movie.id} movie={movie}/>
                    ))
                }
            </ul>

        </div>
    )
};

export default MovieComponent;
